// UserDetails.jsx
import React, { Component } from "react";
import { Form, Button } from "semantic-ui-react";
import TextField from "@material-ui/core/TextField";

class UserDetails extends Component {
  saveAndContinue = e => {
    e.preventDefault();
    this.props.nextStep();
  };

  render() {
    const { values } = this.props;
    return (
      <div className="main-form">
        <Form>
          <div className="column">
            <span
              style={{
                fontSize: "36px",
                padding: "10px",
                float: "right",
                marginLeft: "10%"
              }}
            >
              بيانات الطالب الشخصية
            </span>
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              label="اسم المستخدم"
              name="username"
              autoComplete="username"
              id="inputLabels"
            />
            <Form.Field>
              <label>الرقم القومى :</label>
              <input
                placeholder="National ID"
                onChange={this.props.handleChange("nationalId")}
                defaultValue={values.lastName}
              />
            </Form.Field>
            <Form.Field>
              <label>الإيميل :</label>
              <input
                type="email"
                placeholder="Email Address"
                onChange={this.props.handleChange("email")}
                defaultValue={values.email}
              />
            </Form.Field>

            <Form.Field>
              <label>النوع :</label>
              <input
                placeholder="Gender"
                onChange={this.props.handleChange("gender")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Form.Field>
              <label>العنوان :</label>
              <input
                placeholder="Address"
                onChange={this.props.handleChange("address")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Form.Field>
              <label>رقم التليفون :</label>
              <input
                placeholder="Phone Number"
                onChange={this.props.handleChange("phoneNumber")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Form.Field>
              <label>الجنسية :</label>
              <input
                placeholder="Nationality"
                onChange={this.props.handleChange("nationality")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Form.Field>
              <label>تاريخ الميلاد :</label>
              <input
                placeholder="Birth Date"
                onChange={this.props.handleChange("birthDate")}
                defaultValue={values.lastName}
              />
            </Form.Field>
            <Form.Field>
              <label>الحالة الصحية :</label>
              <input
                placeholder="Medical Condition"
                onChange={this.props.handleChange("medicalCondition")}
                defaultValue={values.lastName}
              />
            </Form.Field>
          </div>
          <div className="column">
            <span
              style={{
                fontSize: "36px",
                padding: "10px",
                float: "right",
                marginLeft: "20%"
              }}
            >
              بيانات ولي الأمر
            </span>
            <Form.Field>
              <label>اسم ولي الأمر :</label>
              <input
                placeholder="Guardian Name"
                onChange={this.props.handleChange("guardianName")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Form.Field>
              <label>الرقم القومى :</label>
              <input
                placeholder="Guardian ID"
                onChange={this.props.handleChange("guardianId")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Form.Field>
              <label>رقم التليفون :</label>
              <input
                placeholder="Phone Number"
                onChange={this.props.handleChange("guardianPhoneNumber")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Form.Field>
              <label>صلة القرابة :</label>
              <input
                placeholder="Relative Relation"
                onChange={this.props.handleChange("relativeRelation")}
                defaultValue={values.lastName}
              />
            </Form.Field>

            <Button className="progress-button" onClick={this.saveAndContinue}>
              Save And Continue{" "}
            </Button>
          </div>
        </Form>
      </div>
    );
  }
}

export default UserDetails;
